import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import './App.css';
import NavBar from './components/NavBar';
import RecordedFootageDetection from './components/RecordedFootageDetection';

function LiveDetect() {
  return (
    <div>
      <h2>Live Detect</h2>
      <p>Live detection functionality coming soon.</p>
    </div>
  );
}

function App() {
  return (
    <Router>
      <NavBar />
      <Routes>
        <Route path="/" element={<Navigate to="/live-detect" replace />} />
        <Route path="/live-detect" element={<LiveDetect />} />
        <Route path="/recorded-detect" element={<RecordedFootageDetection />} />
      </Routes>
    </Router>
  );
}

export default App;
